window.bookSummaryJSON = "<p>Long before she was the terror of Wonderland, she was just a girl who wanted to fall in love. </p> <p>Catherine may be one of the most desired girls in Wonderland and a favorite of the unmarried King of Hearts, but her interests lie elsewhere. A talented baker, all she wants is to open a shop with her best friend. But according to her mother, such a goal is unthinkable for the young woman who could be the next queen. </p> <p>Then Cath meets Jest, the handsome and mysterious court joker. For the first time, she feels the pull of true attraction. At the risk of offending the king and infuriating her parents, she and Jest enter into an intense secret courtship. Cath is determined to define her own destiny and fall in love on her terms. But in a land thriving with magic, madness, and monsters, fate has other plans. </p> <p>In her first stand-alone teen audiobook, the <i>New York Times</i> best-selling author dazzles us with a prequel to <i>Alice's Adventures in Wonderland</i>. </p>"; 
